let date = findFormField("textfield_24");

if (/\d{2}\.\d{2}\.\d{4}/.test(date.value)) {

let arr = date.value.match(/(\d{2})\.(\d{2})\.(\d{4})/);
if (arr[1] > 31 || arr[1] < 1) {
findFormField("textfield_25").inputEl.dom.value = "Укажите день в диапазоне «01-31»";
findFormField("textfield_25").value = "Укажите день в диапазоне «01-31»";
return;
}

if (arr[2] > 12 || arr[2] < 1) {
findFormField("textfield_25").inputEl.dom.value = "Укажите месяц в диапазоне «01-12»";
findFormField("textfield_25").value = "Укажите месяц в диапазоне «01-12»";
return;
}

let newDate = new Date(arr[3] + "-" + arr[2] + "-" + arr[1]);
newDate.setMonth(newDate.getMonth() + 6);
if (newDate.getDay() == 6) {
newDate.setDate(newDate.getDate() + 2);
}
if (newDate.getDay() == 0) {
newDate.setDate(newDate.getDate() + 1);
}
let ye = new Intl.DateTimeFormat('en', { year: 'numeric' }).format(newDate);
let mo = new Intl.DateTimeFormat('en', { month: '2-digit' }).format(newDate);
let da = new Intl.DateTimeFormat('en', { day: '2-digit' }).format(newDate);


findFormField("textfield_25").inputEl.dom.value = da + "." + mo + "." + ye;
findFormField("textfield_25").value = da + "." + mo + "." + ye;

} else { 

findFormField("textfield_25").inputEl.dom.value = "Укажите дату в формате «01.01.1970»";
findFormField("textfield_25").value = "Укажите дату в формате «01.01.1970»";

}
